from urllib.parse import urlencode
from urllib.request import urlopen
import simplejson
from datetime import datetime
from dateutil.relativedelta import relativedelta
import pprint
pp = pprint.PrettyPrinter()



def distance_api(origin, destinations, **geo_args):
    # Adjustable Variables
    TRAFFIC_MODEL = 'pessimistic'  # Options are 'pessimistic', 'optimistic', and 'best_guess
    MODE = 'driving'  # options are 'driving', 'walking', 'cycling', 'transit'
    DEPARTURE_WEEKDAY = 2  # 0: Monday, 1: Tuesday, 2: Wednesday, etc

    # Static Variables
    weekday = datetime.today().weekday()
    DEPARTURE_TIME = datetime.utcnow() + relativedelta(weekday=DEPARTURE_WEEKDAY if weekday != 2 else 3,
                                                       hour=14,
                                                       minute=0,
                                                       second=0)
    GEOCODE_BASE_URL = "https://maps.googleapis.com/maps/api/distancematrix/json"
    API_KEY = "AIzaSyB9Nd9VVUv2AeW-cLegNm17GPlLOzx_A6w"

    geo_args.update({
        'origins': origin,
        # 'destinations': destinations,
        'traffic_model': TRAFFIC_MODEL,
        'departure_time': int(DEPARTURE_TIME.timestamp()),
        'mode': MODE
    })

    d = ""
    # Build the URL for all destinations
    for address in destinations:
        d += str(address['Lat'] + '%2c' + address['Lon'] + '%7C')

    url = GEOCODE_BASE_URL + '?' + urlencode(geo_args) + "&destinations=" + d + '&key=' + API_KEY
    results = simplejson.load(urlopen(url))
    print("Google Distance Matrix API call", url)

    i = -1
    for result in results['rows'][0]['elements']:
        i += 1
        if results['rows'][0]['elements'][0]['status'] != 'OK':
            del destinations[i]
            print('couldn\'nt find a route1')
            continue

        distance = round(result['distance']['value'] / 1000, 3)  # km
        duration = round(result['duration']['value'] / 60, 3)  # minutes
        duration_in_traffic = round(result['duration_in_traffic']['value'] / 60, 3)  # minutes
        durations = {"drive_distance": distance,
                     "duration no traffic": duration,
                     "duration with traffic": duration_in_traffic}
        destinations[i].update(durations)

    if len(destinations) is 0:
        print("ERROR: Google could not find a path in between the address and any clients. Try a new address")
        return False

    return destinations


